			var metadataObject = new TOM.ModelRole();
			metadataObject.Name = parent.Roles.GetNewName(string.IsNullOrWhiteSpace(name) ? "New " + typeof(ModelRole).GetTypeName() : name);
            InitMetadata(metadataObject, parent);
