            var json = TOM.JsonSerializer.SerializeObject(MetadataObject, RenewMetadataOptions);
            MetadataObject = TOM.JsonSerializer.DeserializeObject<TOM.Partition>(json);
            Handler.WrapperLookup.Add(MetadataObject, this);
        }

